    const logoutHandler = ()=>{
        dispatch(setUser(null))
        dispatch(setToken(null))
        navigator("/")
        window.location.reload();
    }

    function makeMenu() {
        if(user.Role === "Normal") setNavItems(Normal)

        else if(user.Role === "Operator"){
            if(user.Approved) setNavItems(OperatorApproved);
            else{
                setNavItems(OperatorNotApproved)
                navigator('/editorDashboard/not_approved')
            }
        } 

        else setNavItems(Admin)
    }


    useEffect(()=>{
        makeMenu()
    },[])
 
